import React from 'react';

var data = ['Ruler', 'Pen', 'Book'];

class Item extends React.Component {
  render() {
    return (
    <li>{this.props.name} : {this.props.price}</li>
    )
  }
}

class App extends React.Component {
  render() {
    return (
      <div>
        <h1>Hello React</h1>
        <p>USER NAME: KYAW GYI</p>
        <ul>
          {data.map( i => {
            return (<Item name={i}/>)
          })}
          <Item name="Apple" price="350 MMK"/>
          <Item name="Watermelon" price="500 MMK"/>
          <Item name="Banana" price="200 MMK"/>
        </ul>
      </div> 
    )
  }
}

export default App;
